import React from 'react';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import TopBar from '../TopBar'
import {DASH_SUBTITLE} from '../../utils/Messages'
import { ThemeProvider, withTheme } from '@material-ui/core/styles';

class DashComp extends React.Component{

	constructor(props){
		super(props)
	}

	render() {
		return (
			<ThemeProvider theme={this.props.theme}>
			<div>
			<TopBar />
			<Button variant="contained"> Sample Call </Button>
			<Grid container spacing={1}>
				<Grid item xs={12}>
					{DASH_SUBTITLE}
				</Grid>
			</Grid>			
			</div>
			</ThemeProvider>);
	}

}

export default withTheme(DashComp);
